import { Link } from "react-router-dom";
import style from "./NavBar.module.css";
import { useSelector } from "react-redux";
// importo los carchivos para poder hacer uso de Bootstrap
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";

const NavBar = () => {
  const authenticated = useSelector((state) => state.isAuthenticated);
  const adminUser = useSelector((state) => state.profileUser);
  return (
    <>
      <div className={style.mainContainer}>
        {authenticated === true && adminUser.admin === true && (
          <>
            <nav class="navbar navbar-expand-lg bg-body-tertiary">
              <div class="container-fluid">
                <a class="navbar-brand" href="#">
                  Navbar
                </a>
                <button
                  class="navbar-toggler"
                  type="button"
                  data-bs-toggle="collapse"
                  data-bs-target="#navbarNav"
                  aria-controls="navbarNav"
                  aria-expanded="false"
                  aria-label="Toggle navigation"
                >
                  <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarNav">
                  <ul class="navbar-nav">
                    <li class="nav-item">
                      <a class="nav-link active" aria-current="page" href="#">
                        <Link to="/Home">Home</Link>
                      </a>
                    </li>
                    <li class="nav-item">
                      <a class="nav-link" href="#">
                        <Link to="/userProfile">UserProfile</Link>
                      </a>
                    </li>
                  </ul>
                </div>
              </div>
            </nav>
          </>
        )}
      </div>
    </>
  );
};

export default NavBar;
